function PrimarySelect(props) {

  return (
    <div>
      <select
        className="form-control"
        style={{ width: 200 }}
        name="primarySelect"
        id="primarySelect"
        onChange={props.setSortingCategory}
      >
        <option value="published" selected={false}>Publisert</option>
        <option value="price_desc" selected={true}>Pris lav til høy</option>
        <option value="price_asc">Pris høy til lav</option>
      </select>
    </div>
  );
}

export default PrimarySelect;
